import '../css/style-button.css'
import React from 'react';


const Button = (props) => {
    const style = {
        background: "red",
        color: "white",
    }

    return(
        <button className = "button-layout" onClick = {props.onButtonClick} style = {style}>
            <i className = {`fa ${props.iconName}`}/>
            <span style ={{marginLeft: "20px"}}>{props.children}</span>
        </button>
    );
}



export default Button;
